import React from 'react';
import {Route, Switch, useHistory} from 'react-router-dom';
import Header from "./Header"
import Nav from "./Nav"

function App() {
  return (
    <div className="app">
      <div className="header">
        <Header />
      </div>
      <div className="nav">
        <Nav />
      </div>
    </div>
  );
}

export default App;
